import './options.css';

const Options = () => {
    return(
        <div className='options'>
            <div className='selector'>
                <select name='size' id='size-options'>
                    <option value="">(Par défaut) 3x3</option>
                    <option value="">(Par défaut) 3x3</option>
                    <option value="">(Par défaut) 3x3</option>
                    <option value="">(Par défaut) 3x3</option>
                    <option value="">(Par défaut) 21x21</option>
                </select>
            </div>
            <div className='start'>
                <button className='gameStart'><a>Commencer la partie</a></button>
            </div>
        </div>
    )
}


export default Options;
